description:
Alison Tyler, Stormy Daniels, Dana DeArmond, Sasha Heart, Asa Akira, Lexi Belle, Lezley Zen, Paisley Parker, Allie Haze, Chanel Preston

Tonight anything goes... Erica (Stormy Daniels) and her long time girlfriend are thrilled that the changing laws have finally allowed them to marry. But before they tie the knot, Erica has a girls night out with her college roommate and some of her fellow lesbian friends. After a long night of celebrating, the girls return home and begin to reminisce about first loves, first times and hot sex.


